var searchBar=document.getElementById("vel-search"),timeFunction=document.getElementById("vel-time");function getTimeFormat(){switch(timeFunction.getAttribute("vel-time-format").toLowerCase()){case"24h":setupTime("twentyfour");break;case"12h":setupTime("twelve");break;default:unknownTimeFormat()}}function getSearchEngine(){switch(searchBar.getAttribute("vel-search-default").toLowerCase()){case"ask":setupSearch("https://www.ask.com/web?q=");break;case"bing":setupSearch("https://www.bing.com/search?q=");break;case"duckduckgo":setupSearch("https://duckduckgo.com/?q=");break;case"ecosia":setupSearch("https://www.ecosia.org/search?q=");break;case"google":setupSearch("https://www.google.com/search?q=");break;case"yahoo":setupSearch("https://search.yahoo.com/search?p=");break;case"yandex":setupSearch("https://yandex.com/search/?text=");break;default:unknownSearch()}}function search(e){var t=document.getElementById("vel-search-1").value;for(i in t)t=String(t.replace(" ","+"));var n=String(e+t.replace(" ","+"));return location=String(n),!1}function setupTime(e){var t=new Date,n=t.getHours(),r=t.getMinutes();if(r<10&&(r=0+String(r)),"twentyfour"==e)timeFunction.innerHTML=`\n            <p>${n}:${r}</p>\n        `;else if("twelve"==e){var a="AM";n>12&&(a="PM",n-=12),timeFunction.innerHTML=`\n            <p>${n}:${r} ${a}</p>\n        `}setTimeout(function(){setupTime(e)},100)}function setupSearch(e){searchBar.innerHTML="\n        <form onsubmit=\"return search('"+String(e)+'\');">\n            <input id="vel-search-1" type="text" name="vel-search" placeholder="Search for...">\n            <input type="submit" value="Search" name="button">\n        </form>\n    '}function unknownSearch(){searchBar.innerHTML="\n    <p>Velstart error: Unknown search engine, please check implementation!</p>\n    "}function unknownTimeFormat(){timeFunction.innerHTML="\n        <p>Velstart error: Unknown time format</p>\n    "}searchBar&&getSearchEngine(),timeFunction&&getTimeFormat();